someone turned 6 today 🥺

I’ll save you all my mushy feelings (for today) and just say;
1. I can’t believe we’re here, time is flying by and I can’t seem to retain the memory of each and every special moment but I try my best to savour it all in the moment;
2. Kukhanya is still the sweetest, most loving and intelligent little man I’ve ever known and that’s not only because of me or his dad and our village- it’s just him, his personhood;
3. I am ever so grateful that I get to experience such a beautiful human being;
4 I pray his life is filled with so much joy, abundance, peace, love and success forever;
5. He said he had a great birthday even though he was sick so that’s a win in my parenting book.

